      formatted_address,
      formatted_phone_number,
      name,
      place_id,
      rating,
      url,
      website,
      user_ratings_total,
      reviews,
      photos,
      geometry: {
        location: { lat, lng },
      },
    } = detailedDoctor;

    // ES6 key value assignment operator

    const doctorHash = {
      place_id,
      name,
      formatted_address,
      rating,
      user_ratings_total,
      formatted_phone_number,
      lat,
      lng,
      url,
      website,
      photos,
      reviews,
    };

    // create post headers
    const myHeaders = new Headers();

